(245, 1, '2016-07-16 01:30:52', '2016-07-16 05:30:52', 'If you have a problem with anything for any reason, please message me.\r\n\r\nWe work hard to produce quality jewelry and to represent our work as well as we can; because this isn\'t as easy as a personal encounter, we offer a 14-day exchange or store credit policy. You must contact me before attempting to return a package, otherwise it will not be accepted. Any returned pieces must be in their original, unaltered condition and packaging with the packing slip. Custom items are non-returnable or exchangeable. Shipping and other fees are not refundable. We are not responsible for return shipping or items lost or damaged in shipment.', 'Policies', '', 'inherit', 'closed', 'closed', '', '244-revision-v1', '', '', '2016-07-16 01:30:52', '2016-07-16 05:30:52', '', 244, 'http://hammerheadsilver.com/index.php/2016/07/16/244-revision-v1/', 0, 'revision', '', 0),
