(378, 1, '2018-05-14 20:00:28', '2018-05-15 00:00:28', 'If you have a problem with anything for any reason, please message us. Â We understand things can go wrong, and want to make sure you are completely happy with your new jewelry. We cannot resize rings\n\nWe are two people creating one of a kind jewelry, and unfortunately cannot afford to offer returns for unwanted pieces.\n\nWe are traveling around the U.S. and sometimes stay in places without internet access. Â We check emails as often as possible, so if you are waiting to hear back, please be understanding of this situation!', 'Policies', '', 'inherit', 'closed', 'closed', '', '244-autosave-v1', '', '', '2018-05-14 20:00:28', '2018-05-15 00:00:28', '', 244, 'http://hammerheadsilver.com/index.php/2018/05/14/244-autosave-v1/', 0, 'revision', '', 0),
